import './App.css';
import ImageDetection from './components/ImageDetection.js';
import RealDetection from './components/RealDetection.js';

function App() {
  return (
    <div className="App vh-100 d-flex flex-column align-items-center text-white">

      <div className="header-app text-center mt-3 mb-3">
        <h1 className="text-danger"><strong>DETECTION - CLASSIFICATION</strong></h1>
        <h5><i>Breve descrizione dell'applicazione</i></h5>
        <hr className="mb-5"/>
      </div>

      <div className="container vh-100 d-flex flex-column align-items-center justify-content-center mb-3">

        <div className="Componente1 d-flex flex-column align-items-center border-bottom">
          <RealDetection />
        </div>

        <div className="Componente2 d-flex flex-column align-items-center">
          <ImageDetection />
        </div>

      </div>

    </div>
  );
}

export default App;
